import React from 'react';
import {BrowserRouter as Router,Link} from "react-router-dom";
import { BodyHomeBody, PageBody, Titre2} from './BodyHome';

function getDisponible() {
    const Jour = new Date();
    Jour = Jour.getDay();
    if(Jour >0 && Jour < 3)return "Aujourd'hui nous faisons des Pizzas !";
    else return "Aujourd'hui nous ne faisons pas de Pizza mais nous allons revenir";
}

const BodyHome = () => {
    /*const Emplacement =json('../../../src/data/Emplacement.json');*/
    const Disponible = getDisponible();
    return (
        <>
            <Router forceRefresh={true}>
                <BodyHomeBody>
                    <PageBody>
                        <Titre2>{Disponible}</Titre2>
                        
                    </PageBody>
                </BodyHomeBody>
            </Router>
        </>
    );
}

export default BodyHome;
